import React from 'react'
import { Button } from '../components/ui'

const ErrorPage: React.FC = (): React.ReactElement => {
	return (
		<div>
			<h1>Страница не найдена.</h1>
			<Button text="Вернуться на главную" />
		</div>
	)
}


export default ErrorPage
